import React from 'react'
import Wrapper from './wrapper'
import Card from './card'
import characters from '../characters.json'
import '../styles/main.css'

function Main () {
  return (
    <Wrapper>
      <main class='container'>
        <Card
          image={characters.image}
          name={characters[5].name}
        />
      </main>
    </Wrapper>
  )
}

export default Main
